											<h1 class="title">
				<a href="/en/nghien-cuu/nghien-cuu-thuc-nghiem/dc-nhien-lieu-kep/combustion-analysis-of-biogas-premixed-charge-diesel-dual-fuelled-engine.html">New Paper on International Journal of Engineering Research &amp; Technology</a>				</h1>
									
				
		</div>
		<div class="module-content">
					
						
					
			<p style="text-align: center;">
	<span style="font-family:tahoma,geneva,sans-serif;"><strong><span style="font-size: 20px;"><span style="color: rgb(0, 128, 0);">Combustion Analysis of Biogas Premixed Charge Diesel Dual Fuelled Engine</span></span></strong></span><br />
	<br />
	<span style="font-size:12px;">Bui Van Ga, Tran Van Nam, Le Minh Tien, Bui Thi Minh Tu<br />
	University of Science and Technology &ndash; The university of Danang, Vietnam<br />
	Email: 
