	<span style="font-size: 11.8181819915771px;">http://www.ijert.org/view.php?id=11611&amp;title=combustion-analysis-of-biogas-premixed-charge-diesel-dual-fuelled-engine</span><br />
	<br />
	<img alt="" src="http://dongcobiogas.com/vi/images/bia%20IJERT%281%29.png" style="width: 241px; height: 314px;" /><br />
	<br />
	<br />
	<strong>Abstract</strong></p>
<p style="text-align: justify;">
	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Biogas engines are mostly converted from commercial compression or spark ignition engines. Some available researches have evaluated the use of biogas in relatively high power engines. However the similar publications on small engines is still limited. This paper suggests a general way to predict the performance of a biogas premixed charge diesel dual fuelled engine converted from a small single cylinder, stationary diesel engine which are very popular in rural areas of developing countries.<br />
	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Combustion of biogas-air mixture ignited by diesel injection in the combustion chamber of the engine is analyzed by CFD software FLUENT. Effects of biogas composition and operation parameters on engine performance are considered. The simulation is applied initially on a typical biogas diesel dual fuel engine converted from Vikyno EV2600NB diesel engine but this general procedure can be then applied on other kind of diesel engines. The prediction given by the simulation are very helpful for conversion technology of various kinds of diesel engines to biogas diesel dual fuel engine.</p>		
				
						
